function Invoke-ShareHunter{

	<#

	.SYNOPSIS
	Invoke-ShareHunter Author: Rob LP (@L3o4j)
	https://github.com/Leo4j/Invoke-ShareHunter

 	#>
	
	[CmdletBinding()] Param(
		
		[Parameter (Mandatory=$False, ValueFromPipeline=$true)]
		[String]
		$Domain,
		
		[Parameter (Mandatory=$False, ValueFromPipeline=$true)]
		[array]
		$Computers
		
	)
	
	$ErrorActionPreference = "SilentlyContinue"

	# Initialize the runspace pool
	$runspacePool = [runspacefactory]::CreateRunspacePool(1, 10)
	$runspacePool.Open()

	# Define the script block outside the loop for better efficiency
	$scriptBlock = {
		param ($computer)
		$tcpClient = New-Object System.Net.Sockets.TcpClient
		$asyncResult = $tcpClient.BeginConnect($computer, 445, $null, $null)
		$wait = $asyncResult.AsyncWaitHandle.WaitOne(50)
		if ($wait) {
			try {
				$tcpClient.EndConnect($asyncResult)
				return $computer
			} catch {}
		}
		$tcpClient.Close()
		return $null
	}

	# Use a generic list for better performance when adding items
	$runspaces = New-Object 'System.Collections.Generic.List[System.Object]'

	foreach ($computer in $Computers) {
		$powerShellInstance = [powershell]::Create().AddScript($scriptBlock).AddArgument($computer)
		$powerShellInstance.RunspacePool = $runspacePool
		$runspaces.Add([PSCustomObject]@{
			Instance = $powerShellInstance
			Status   = $powerShellInstance.BeginInvoke()
		})
	}

	# Collect the results
	$reachable_hosts = @()
	foreach ($runspace in $runspaces) {
		$result = $runspace.Instance.EndInvoke($runspace.Status)
		if ($result) {
			$reachable_hosts += $result
		}
	}

	# Update the $Computers variable with the list of reachable hosts
	$Computers = $reachable_hosts

	# Close and dispose of the runspace pool for good resource management
	$runspacePool.Close()
	$runspacePool.Dispose()
	
	$functiontable = @()
	
	# Create runspace pool
	$runspacePool = [runspacefactory]::CreateRunspacePool(1, 10)
	$runspacePool.Open()

	$runspaces = @()

	foreach ($Computer in $Computers) {
		$scriptBlock = {
			param($Computer)

			# Getting all shares including hidden ones
			$allResults = net view \\$Computer /ALL | Out-String

			$startDelimiter = "-------------------------------------------------------------------------------"
			$endDelimiter = "The command completed successfully."

			$extractShares = {
			    param($results)
			    
			    $startIndex = $results.IndexOf($startDelimiter)
			    $endIndex = $results.IndexOf($endDelimiter)
			
			    $capturedContent = $results.Substring($startIndex + $startDelimiter.Length, $endIndex - $startIndex - $startDelimiter.Length).Trim()
			
			    return ($capturedContent -split "`n") | Where-Object { $_ -match '^(.+?)\s{2,}' } | ForEach-Object { $matches[1] }
			}

			$allShares = & $extractShares $allResults

			# Create hashtable for each share
			return $allShares | ForEach-Object {
				@{
					'Targets'  = $Computer
					'Share'    = $_
					'FullShareName'    = $null
					'Readable' = 'NO'
					'Writable' = 'NO'
					'Domain'   = $Domain  # Assuming $Domain is available in this context
				}
			}
		}

		$runspace = [powershell]::Create().AddScript($scriptBlock).AddArgument($Computer)
		$runspace.RunspacePool = $runspacePool

		$runspaces += [PSCustomObject]@{
			Runspace = $runspace
			Status   = $runspace.BeginInvoke()
			Computer = $Computer
		}
	}

 	# Initialize an array to store all shares
	$AllShares = @()

	# Collect the results from each runspace
	$runspaces | ForEach-Object {
		$shares = $_.Runspace.EndInvoke($_.Status)
		if ($shares) { 
			$functiontable += $shares

   			foreach($shareObj in $shares) {
				$shareObj.Domain = $Domain
				$sharename = "\\" + $shareObj.Targets + "\" + $shareObj.Share
				$shareObj.FullShareName = $sharename
				$AllShares += $sharename
			}
		}
	}

	# Close and clean up the runspace pool
	$runspacePool.Close()
	$runspacePool.Dispose()

	$runspacePool = [runspacefactory]::CreateRunspacePool(1, 10)
	$runspacePool.Open()

	$runspaces = @()

	foreach ($obj in $functiontable) {
		$scriptBlock = {
			param($obj)

			$Error.clear()
			ls $obj.FullShareName > $null
			if (!$error[0]) {
   				$obj.Readable = "YES"
				return $obj.FullShareName
			} else {
				return $null
			}
		}

		$runspace = [powershell]::Create().AddScript($scriptBlock).AddArgument($obj)
		$runspace.RunspacePool = $runspacePool

		$runspaces += [PSCustomObject]@{
			Runspace = $runspace
			Status   = $runspace.BeginInvoke()
			Share    = $obj
		}
	}

	# Initialize an array to store all readable shares
	$ReadableShares = @()

	# Collect the results from each runspace
	$runspaces | ForEach-Object {
		$shareResult = $_.Runspace.EndInvoke($_.Status)
		if ($shareResult) {
			$ReadableShares += $shareResult
		}
	}

	# Close and clean up the runspace pool
	$runspacePool.Close()
	$runspacePool.Dispose()

	$runspacePool = [runspacefactory]::CreateRunspacePool(1, 10)
	$runspacePool.Open()

	$runspaces = @()

	foreach ($Share in $ReadableShares) {
		$scriptBlock = {
			
			param(
				[Parameter(Mandatory=$true)]
				[string]$Share
			)
			
			function Test-Write {
				[CmdletBinding()]
				param (
					[parameter()]
					[string] $Path
				)
				try {
					$testPath = Join-Path $Path ([IO.Path]::GetRandomFileName())
					$fileStream = [IO.File]::Create($testPath, 1, 'DeleteOnClose')
					$fileStream.Close()
					return "$Path"
				} finally {
					Remove-Item $testPath -ErrorAction SilentlyContinue
				}
			}
			
			try {
				$result = Test-Write -Path $Share
				return @{
					Share = $Share
					Result = $result
					Error = $null
				}
			} catch {
				return @{
					Share = $Share
					Result = $null
					Error = $_.Exception.Message
				}
			}
		}


		$runspace = [powershell]::Create().AddScript($scriptBlock).AddArgument($Share)

		$runspace.RunspacePool = $runspacePool

		$runspaces += [PSCustomObject]@{
			Runspace = $runspace
			Status   = $runspace.BeginInvoke()
			Share    = $Share
		}
	}

	# Initialize an array to store all writable shares
	$WritableShares = @()

	# Collect the results from each runspace
	$runspaces | ForEach-Object {
		$runspaceData = $_.Runspace.EndInvoke($_.Status)
		if ($runspaceData.Result) {
			$WritableShares += $runspaceData.Result
		}
	}

	# Close and clean up the runspace pool
	$runspacePool.Close()
	$runspacePool.Dispose()
	
	foreach ($Share in $WritableShares) {
		foreach ($obj in $functiontable) {
			if($obj.FullShareName -eq $Share){
				$obj.Writable = "YES"
			}
		}
	}
	
	$FinalTable = @()
	
	$FinalTable = foreach ($obj in $functiontable) {
		if($obj.Readable -eq "YES"){
			[PSCustomObject]@{
				'Targets'  = $obj.Targets
				'Share Name'    = $obj.FullShareName
				'Readable' = $obj.Readable
				'Writable' = $obj.Writable
				'Domain'   = $obj.Domain
			}
		}
	}
	
	$FinalTable
}

function Test-LDAPPorts {
    [CmdletBinding()]
    param(
        [string] $ServerName,
        [int] $Port
    )
    if ($ServerName -and $Port -ne 0) {
        try {
            $LDAP = "LDAP://" + $ServerName + ':' + $Port
            $Connection = [ADSI]($LDAP)
            $Connection.Close()
            return $true
        } catch {
            if ($_.Exception.ToString() -match "The server is not operational") {
                Write-Warning "Can't open $ServerName`:$Port."
            } elseif ($_.Exception.ToString() -match "The user name or password is incorrect") {
                Write-Warning "Current user ($Env:USERNAME) doesn't seem to have access to to LDAP on port $Server`:$Port"
            } else {
                Write-Warning -Message $_
            }
        }
        return $False
    }
}
Function Test-LDAP {
    [CmdletBinding()]
    param (
        [alias('Server', 'IpAddress')][Parameter(Mandatory = $True)][string[]]$ComputerName,
        [int] $GCPortLDAP = 3268,
        [int] $GCPortLDAPSSL = 3269,
        [int] $PortLDAP = 389,
        [int] $PortLDAPS = 636
    )
    # Checks for ServerName - Makes sure to convert IPAddress to DNS
    foreach ($Computer in $ComputerName) {
        [Array] $ADServerFQDN = (Resolve-DnsName -Name $Computer -ErrorAction SilentlyContinue)
        if ($ADServerFQDN) {
            if ($ADServerFQDN.NameHost) {
                $ServerName = $ADServerFQDN[0].NameHost
            } else {
                [Array] $ADServerFQDN = (Resolve-DnsName -Name $Computer -ErrorAction SilentlyContinue)
                $FilterName = $ADServerFQDN | Where-Object { $_.QueryType -eq 'A' }
                $ServerName = $FilterName[0].Name
            }
        } else {
            $ServerName = ''
        }

        $GlobalCatalogSSL = Test-LDAPPorts -ServerName $ServerName -Port $GCPortLDAPSSL
        $GlobalCatalogNonSSL = Test-LDAPPorts -ServerName $ServerName -Port $GCPortLDAP
        $ConnectionLDAPS = Test-LDAPPorts -ServerName $ServerName -Port $PortLDAPS
        $ConnectionLDAP = Test-LDAPPorts -ServerName $ServerName -Port $PortLDAP

        $PortsThatWork = @(
            if ($GlobalCatalogNonSSL) { $GCPortLDAP }
            if ($GlobalCatalogSSL) { $GCPortLDAPSSL }
            if ($ConnectionLDAP) { $PortLDAP }
            if ($ConnectionLDAPS) { $PortLDAPS }
        ) | Sort-Object
        [pscustomobject]@{
            Computer           = $Computer
            ComputerFQDN       = $ServerName
            GlobalCatalogLDAP  = $GlobalCatalogNonSSL
            GlobalCatalogLDAPS = $GlobalCatalogSSL
            LDAP               = $ConnectionLDAP
            LDAPS              = $ConnectionLDAPS
            AvailablePorts     = $PortsThatWork -join ','
        }
    }
}

function ConvertFrom-SecureStringAES {
    param (
        [byte[]]$encryptedStringWithIV,
        [byte[]]$key,
        [string]$IVBase64,
        [string]$SaltBase64
    )

    $aesManaged = New-Object System.Security.Cryptography.AesManaged
    $aesManaged.Mode = [System.Security.Cryptography.CipherMode]::CBC
    $aesManaged.Padding = [System.Security.Cryptography.PaddingMode]::PKCS7
    $IV = [Convert]::FromBase64String($IVBase64)
    $Salt = [Convert]::FromBase64String($SaltBase64)
    $aesManaged.Key = $key
    $aesManaged.IV = $IV
    $decryptor = $aesManaged.CreateDecryptor($aesManaged.Key, $aesManaged.IV)
    $IVLength = 16
    $IV = $encryptedStringWithIV[0..($IVLength-1)]
    $encryptedString = $encryptedStringWithIV[$IVLength..($encryptedStringWithIV.Length-1)]
    $decryptedBytes = $decryptor.TransformFinalBlock($encryptedString, 0, $encryptedString.Length)
    [System.Text.Encoding]::UTF8.GetString($decryptedBytes)
}

function Find-LocalAdminAccess {
	
	param (
		[string]$Targets,
		[string]$Command,
		[string]$Domain,
		[string]$DomainController
	)
	
	if(!$ShowErrors){
		$ErrorActionPreference = "SilentlyContinue"
		$WarningPreference = "SilentlyContinue"
	}

	if ($Targets) {
		$TestPath = Test-Path $Targets
	
		if($TestPath){
			$Computers = Get-Content -Path $Targets
			$Computers = $Computers | Sort-Object -Unique
		}
		
		else{
			$Computers = $Targets
			$Computers = $Computers -split ","
			$Computers = $Computers | Sort-Object -Unique
		}
	} 
	
	else {
		$Computers = @()
		$objSearcher = New-Object System.DirectoryServices.DirectorySearcher
		if($Domain){
			if($DomainController){
				$TempDomainName = "DC=" + $Domain.Split(".")
				$domainDN = $TempDomainName -replace " ", ",DC="
				$ldapPath = "LDAP://$DomainController/$domainDN"
				$objSearcher.SearchRoot = New-Object System.DirectoryServices.DirectoryEntry($ldapPath)
			}
			else{$objSearcher.SearchRoot = New-Object System.DirectoryServices.DirectoryEntry("LDAP://$Domain")}
		}
		else{$objSearcher.SearchRoot = New-Object System.DirectoryServices.DirectoryEntry}
		$objSearcher.Filter = "(&(sAMAccountType=805306369)(!(userAccountControl:1.2.840.113556.1.4.803:=2)))"
		$objSearcher.PageSize = 1000
		$Computers = $objSearcher.FindAll() | ForEach-Object { $_.properties.dnshostname }
		$Computers = $Computers | Sort-Object -Unique
	}

    $Computers = $Computers | Where-Object { $_ -and $_.trim() }
	$HostFQDN = [System.Net.Dns]::GetHostByName(($env:computerName)).HostName
	$TempHostname = $HostFQDN -replace '\..*', ''
	$Computers = $Computers | Where-Object {$_ -ne "$HostFQDN"}
	$Computers = $Computers | Where-Object {$_ -ne "$TempHostname"}
	
	# Create a runspace pool
	$runspacePool = [runspacefactory]::CreateRunspacePool(1, $Threads)
	$runspacePool.Open()
	$runspaces = New-Object System.Collections.ArrayList

	$scriptBlock = {
		param ($computerName)

		Function Test-Port {
			param ($ComputerName, $Port)
			$tcpClient = New-Object System.Net.Sockets.TcpClient
			$asyncResult = $tcpClient.BeginConnect($ComputerName, $Port, $null, $null)
			$wait = $asyncResult.AsyncWaitHandle.WaitOne(100)

			if ($wait) {
				try {
					$tcpClient.EndConnect($asyncResult)
					return $true
				}
				catch {
					return $false
				}
			}
			else {
				return $false
			}
		}

		# Check Ports
		$WinRMPort = Test-Port -ComputerName $ComputerName -Port 5985
		$WMIPort = Test-Port -ComputerName $ComputerName -Port 135
		$SMBPort = Test-Port -ComputerName $ComputerName -Port 445


		# if all three fail, return and kill the runspace
		if (-not $SMBPort -and -not $WMIPort -and -not $WinRMPort) {
			return "Unable to connect"
		}

		# SMB Check
		if ($SMBPort) {
			$SMBCheck = Test-Path "\\$ComputerName\c$" -ErrorAction SilentlyContinue
			if (-not $SMBCheck) {
				$SMBAccess = $False
			}
			else {
				$SMBAccess = $True
			}
		}

		# WMI Check
		if ($WMIPort) {
			try {
				Get-WmiObject -Class Win32_OperatingSystem -ComputerName $ComputerName -ErrorAction Stop
				$WMIAccess = $True
			}
			catch {
				$WMIAccess = $False
			}
		}

		# WinRM Check
		if ($WinRMPort) {
			try {
				Invoke-Command -ComputerName $computerName -ScriptBlock { whoami } -ErrorAction Stop
				$WinRMAccess = $True
			}
			catch {
				if ($_.Exception.Message -like "*Access is Denied*") {
					$WinRMAccess = $False
				}
				elseif ($_.Exception.Message -like "*cannot be resolved*") {
					$WinRMAccess = $False
				}
			}
		}

		return @{
			WMIAccess   = $WMIAccess
			SMBAccess   = $SMBAccess
			WinRMAccess = $WinRMAccess
		}
	}

	# Create and invoke runspaces for each computer
	foreach ($computer in $computers) {

		$ComputerName = "$Computer"
		
		$runspace = [powershell]::Create().AddScript($scriptBlock).AddArgument($ComputerName)
		$runspace.RunspacePool = $runspacePool

		[void]$runspaces.Add([PSCustomObject]@{
				Runspace     = $runspace
				Handle       = $runspace.BeginInvoke()
				ComputerName = $ComputerName
				Completed    = $false
			})
	}
	
	$results = @()

	# Poll the runspaces and display results as they complete
	do {
		foreach ($runspace in $runspaces | Where-Object { -not $_.Completed }) {
			if ($runspace.Handle.IsCompleted) {
				$runspace.Completed = $true
				$result = $runspace.Runspace.EndInvoke($runspace.Handle)
			
				if ($result -eq "Unable to connect") { continue }

				# Build string of successful protocols
				$successfulProtocols = @()
				if ($result.SMBAccess -eq $True) { $successfulProtocols += "SMB" }
				if ($result.WinRMAccess -eq $True) { $successfulProtocols += "WinRM" }
				if ($result.WMIAccess -eq $True) { $successfulProtocols += "WMI" }

				if ($successfulProtocols.Count -gt 0) {
					$statusText = $successfulProtocols -join ', '
					$obj = New-Object PSObject -Property @{
                        ComputerName = $runspace.ComputerName
                        Protocol = $statusText
                    }
					$results += $obj
					#return $($runspace.ComputerName)
					continue
				}
			}
		}
		Start-Sleep -Milliseconds 100
	} while ($runspaces | Where-Object { -not $_.Completed })
	
	$results | ForEach-Object { Write-Output $_ }

	# Clean up
	$runspacePool.Close()
	$runspacePool.Dispose()
}